        $this->addSql("INSERT INTO politic (id, local_id, title, document) VALUES (1, 1, 'Politique de Confidentialité', '<p>L\'entreprise inpiduelle <strong>AmedeeMusic</strong>, soucieuse des droits des inpidus, notamment au regard des traitements automatisés et dans une volonté de transparence avec ses clients, a mis en place une politique reprenant l’ensemble de ces traitements, des finalités poursuivies par ces derniers ainsi que des moyens d’actions à la disposition des inpidus afin qu’ils puissent au mieux exercer leurs droits.<br><br></p><p>Pour toute information complémentaire sur la protection des données personnelles, nous vous invitons à consulter le site : <a href=\"https://www.cnil.fr/\">https://www.cnil.fr/</a> La poursuite de la navigation sur ce site vaut acceptation sans réserve des dispositions et conditions d\'utilisation qui suivent. La version actuellement en ligne de ces conditions d\'utilisation est la seule opposable pendant toute la durée d\'utilisation du site et jusqu\'à ce qu\'une nouvelle version la remplace.<br><br></p><h1><strong>Article 1 - Mentions légales</strong></h1><p><br></p><p><strong>1.1 Site (ci-après « le site ») :<br>AmedeeMusic </strong>- <a href=\"https://amedeemusic.com/\">amedeemusic.com</a><br><br></p><p><strong>1.2 Éditeur (ci-après « l\'éditeur ») :<br></strong><br></p><p>L\'entreprise inpuduelle <strong>AmedeeMusic </strong>située : 01700 Miribel - France immatriculée au RCS de Dijon 847828183 adresse mail : amedee.management@gmail.com<br><br></p><p><strong>1.3 Hébergeur (ci-après « l\'hébergeur ») :<br></strong><br></p><p><strong>AmedeeMusic </strong>- <a href=\"https://amedeemusic.com/\">amedeemusic.com</a> est hébergé par Ovh, dont le siège social est situé 2 rue Kellermann 59100 Roubaix.<br><br></p><h1><strong>Article 2 - Accès au site</strong></h1><p>L\'accès au site et son utilisation sont réservés à un usage strictement personnel. Vous vous engagez à ne pas utiliser ce site et les informations ou données qui