st sous votre entière responsabilité. Vous devez prendre toutes les mesures appropriées pour protéger votre matériel et vos propres données notamment d\'attaques virales par Internet. Vous êtes par ailleurs seul responsable des sites et données que vous consultez.<br>L\'éditeur ne pourra être tenu responsable en cas de poursuites judiciaires à votre encontre :<br><br></p><ul><li>du fait de l\'usage du site ou de tout service accessible via Internet ;</li><li>du fait du non-respect par vous des présentes conditions générales.</li></ul><p><br></p><p>L\'éditeur n\'est pas responsable des dommages causés à vous-même, à des tiers et/ou à votre équipement du fait de votre connexion ou de votre utilisation du site et vous renoncez à toute action contre lui de ce fait. Si l\'éditeur venait à faire l\'objet d\'une procédure amiable ou judiciaire en raison de votre utilisation du site, il pourra se retourner contre vous pour obtenir l\'indemnisation de tous les préjudices, sommes, condamnations et frais qui pourraient découler de cette procédure.<br><br></p><h1><strong>Article 6 - Liens hypertextes</strong></h1><p>La mise en place par les utilisateurs de tous liens hypertextes vers tout ou partie du site est autorisée par l\'éditeur. Tout lien devra être retiré sur simple demande de l\'éditeur. Toute information accessible via un lien vers d\'autres sites n\'est pas publiée par l\'éditeur. L\'éditeur ne dispose d\'aucun droit sur le contenu présent dans ledit lien.<br><br></p><h1><strong>Article 7 - Collecte et protection des données</strong></h1><p>Vos données sont collectées par l\'entreprise inpiduelle <strong>AmedeeMusic</strong>. Une donnée à caractère personnel désigne toute information concernant une personne physique identifiée ou identifiable (personne concernée) ; est réputée identifiable une personne qui peut être identifiée, directement ou indirectement, notamment par référence à un nom, un numéro d\'identification ou à un ou plusieurs éléments spécifiques, propres à son identité physique, physiologique, génétique, psychique, économique, culturelle ou sociale. Les informations personnelles pouvant être recueillies sur le site sont principalement utilisées par l\'éditeur pour la gestion des relations avec vous, et le cas échéant pour le traitement de vos commandes.<br>Les données personnelles collectées sont les suivantes :<br><br></p><ul><li>nom et prénom</li><li>adresse mail</li></ul><p><br></p><h1><strong>Article 8 - Droit d’accès, de rectification et de déréférencement de vos données</strong></h1><p>En application de la réglementation applicable aux données à caractère personnel, les utilisateurs disposent des droits suivants :<br><br></p><ul><li>le droit d’accès : ils peuvent exercer leur droit d\'accès, pour connaître les données personnelles les concernant, en écrivant à l\'adresse électronique ci-dessous mentionnée. Dans ce cas, avant la mise en œuvre de ce droit, la Plateforme peut demander une preuve de l\'identité de l\'utilisateur afin d\'en vérifier l\'exactitude ;</li><li>le droit de rectification : si les données à caractère personnel détenues par la Plateforme sont inexactes, ils peuvent demander la mise à jour des informations ;</li><li>le droit de suppression des données : les utilisateurs peuvent demander la suppression de leurs données à caractère personnel, conformément aux lois applicables en matière de protection des données ;</li><li>le droit à la limitation du traitement : les utilisateurs peuvent de demander à la Plateforme de limiter le traitement des données personnelles conformément aux hypothèses prévues par le RGPD ;</li><li>le droit de s’opposer au traitement des données : les utilisateurs peuvent s’opposer à ce que leurs données soient traitées conformément aux hypothèses prévues par le RGPD ;</li><li>le droit à la portabilité : ils peuvent réclamer que la Plateforme leur remette les données personnelles qu\'ils ont fournies pour les transmettre à une nouvelle Plateforme.</li></ul><p><br></p><p>Vous pouvez exercer ce droit en nous contactant, à l’adresse suivante : 01700 Miribel - France. Ou par email, à l’adresse : amedee.management@gmail.com<br>Toute demande doit être accompagnée de la photocopie d’un titre d’identité en cours de validité signé et faire mention de l’adresse à laquelle l\'éditeur pourra contacter le demandeur. La réponse sera adressée dans le mois suivant la réception de la demande. Ce délai d\'un mois peut être prolongé de deux mois si la complexité de la demande et/ou le nombre de demandes l\'exigent.<br>De plus, et depuis la loi n°2016-1321 du 7 octobre 2016, les personnes qui le souhaitent, ont la possibilité d’organiser le sort de leurs données après leur décès. Pour plus d’information sur le sujet, vous pouvez consulter le site Internet de la CNIL : <a href=\"https://www.cnil.fr/\">https://www.cnil.fr/</a>.<br>Les utilisateurs peuvent aussi introduire une réclamation auprès de la CNIL sur le site de la CNIL : <a href=\"https://www.cnil.fr.%20/\">https://www.cnil.fr.</a><br>Nous vous recommandons de nous contacter dans un premier temps avant de déposer une réclamation auprès de la CNIL, car nous sommes à votre entière disposition pour régler votre problème.<br><br></p><h1><strong>Article 9 - Utilisation des données</strong></h1><p>Les données personnelles collectées auprès des utilisateurs ont pour objectif la mise à disposition des services de la Plateforme, leur amélioration et le maintien d\'un environnement sécurisé. La base légale des traitements est l’exécution du contrat entre l’utilisateur et la Plateforme. Plus précisément, les utilisations sont les suivantes :<br><br></p><ul><li>accès et utilisation de la Plateforme par l\'utilisateur ;</li><li>gestion du fonctionnement et optimisation de la Plateforme ;</li><li>mise en œuvre d\'une assistance utilisateurs ;</li><li>vérification, identification et authentification des données transmises par l\'utilisateur ;</li><li>personnalisation des services en affichant des publicités en fonction de l\'historique de navigation de l\'utilisateur, selon ses préférences ;</li><li>prévention et détection des fraudes, malwares (malicious softwares ou logiciels malveillants) et gestion des incidents de sécurité ;</li><li>gestion des éventuels litiges avec les utilisateurs ;</li><li>envoi d\'informations commerciales et publicitaires, en fonction des préférences de l\'utilisateur ;</li></ul><p><br></p><h1><strong>Article 10 - Politique de conservation des données</strong></h1><p>La Plateforme conserve vos données pour la durée nécessaire pour vous fournir ses services ou son assistance. Dans la mesure raisonnablement nécessaire ou requise pour satisfaire aux obligations légales ou réglementaires, régler des litiges, empêcher les fraudes et abus ou appliquer nos modalités et conditions, nous pouvons également conserver certaines de vos informations si nécessaire, même après que vous ayez fermé votre compte ou que nous n\'ayons plus besoin pour vous fournir nos services.<br><br></p><h1><strong>Article 11- Partage des données personnelles avec des tiers</strong></h1><p>Les données personnelles peuvent être partagées avec des sociétés tierces exclusivement dans l’Union européenne, dans les cas suivants :<br><br></p><ul><li>lorsque l\'utilisateur publie, dans les zones de commentaires libres de la Plateforme, des informations accessibles au public ;</li><li>quand l\'utilisateur autorise le site web d\'un tiers à accéder à ses données ;</li><li>quand la Plateforme recourt aux services de prestataires pour fournir l\'assistance utilisateurs, la publicité et les services de paiement. Ces prestataires disposent d\'un accès limité aux données de l\'utilisateur, dans le cadre de l\'exécution de ces prestations, et ont l\'obligation contractuelle de les utiliser en conformité avec les dispositions de la réglementation applicable en matière protection des données à caractère personnel ;</li><li>si la loi l\'exige, la Plateforme peut effectuer la transmission de données pour donner suite aux réclamations présentées contre la Plateforme et se conformer aux procédures administratives et judiciaires.</li></ul><p><br></p><h1><strong>Article 12 - Offres commerciales</strong></h1><p>Vous êtes susceptible de recevoir des offres commerciales de l\'éditeur. Si vous ne le souhaitez pas, veuillez cliquer sur le lien suivant : amedee.management@gmail.com. Vos données sont susceptibles d’être utilisées par les partenaires de l\'éditeur à des fins de prospection commerciale, si vous ne le souhaitez pas, veuillez cliquer sur le lien suivant : amedee.management@gmail.com. Si, lors de la consultation du site, vous accédez à des données à caractère personnel, vous devez vous abstenir de toute collecte, de toute utilisation non autorisée et de tout acte pouvant constituer une atteinte à la vie privée ou à la réputation des personnes. L\'éditeur décline toute responsabilité à cet égard. Les données sont conservées et utilisées pour une durée conforme à la législation en vigueur.<br><br></p><h1><strong>Article 13 - Cookies</strong></h1><p>Qu’est-ce qu’un « cookie » ? Un « Cookie » ou traceur est un fichier électronique déposé sur un terminal (ordinateur, tablette, smartphone,…) et lu par exemple lors de la consultation d\'un site internet, de la lecture d\'un courrier électronique, de l\'installation ou de l\'utilisation d\'un logiciel ou d\'une application mobile et ce, quel que soit le type de terminal utilisé (source : <a href=\"https://www.cnil.fr/fr/cookies-traceurs-que-dit-la-loi\">https://www.cnil.fr/fr/cookies-traceurs-que-dit-la-loi</a>). En naviguant sur ce site, des « cookies » émanant de la société responsable du site concerné et/ou des sociétés tiers pourront être déposés sur votre terminal. Lors de la première navigation sur ce site, une bannière explicative sur l’utilisation des « cookies » apparaîtra. Dès lors, en poursuivant la navigation, le client et/ou prospect sera réputé informé et avoir accepté l’utilisation desdits « cookies ». Le consentement donné sera valable pour une période de treize (13) mois. L\'utilisateur a la possibilité de désactiver les cookies à partir des paramètres de son navigateur.<br>Toutes les informations collectées ne seront utilisées que pour suivre le volume, le type et la configuration du trafic utilisant ce site, pour en développer la conception et l\'agencement et à d\'autres fins administratives et de planification et plus généralement pour améliorer le service que nous vous offrons.<br>Les cookies suivants sont présents sur ce site :<br><br></p><ul><li>cookie de loi permettant de ne plus afficher la bannière en bas de page. cookies de reCAPTCHA de google permettant de vérifier que vous n\'êtes pas un robot. cookies de stockage local permettant de charger la page plus rapidement..</li></ul><p><br></p><p>La durée de vie de ces cookies est de treize mois.<br>Pour plus d’informations sur l’utilisation, la gestion et la suppression des « cookies », pour tout type de navigateur, nous vous invitons à consulter le lien suivant : <a href=\"https://www.cnil.fr/fr/cookies-les-outils-pour-les-maitriser\">https://www.cnil.fr/fr/cookies-les-outils-pour-les-maitriser</a>.<br><br></p><h1><strong>Article 14 - Photographies et représentation des produits</strong></h1><p>Les photographies de produits, accompagnant leur description, ne sont pas contractuelles et n\'engagent pas l\'éditeur.<br><br></p><h1><strong>Article 15 - Loi applicable</strong></h1><p>Les présentes conditions d\'utilisation du site sont régies par la loi française et soumises à la compétence des tribunaux du siège social de l\'éditeur, sous réserve d\'une attribution de compétence spécifique découlant d\'un texte de loi ou réglementaire particulier.<br><br></p><h1><strong>Article 16 - Contactez-nous</strong></h1><p>Pour toute question, information sur les produits présentés sur le site, ou concernant le site lui-même, vous pouvez laisser un message à l\'adresse suivante : amedee.management@gmail.com.</p>'), (2, 2, 'Privacy Policy', '<p>Updated at 2023-07-05<br><br></p><p><strong>AmedeeMusic </strong>(“we,” “our,” or “us”) is committed to protecting your privacy. This Privacy Policy explains how your personal information is collected, used, and disclosed by <strong>AmedeeMusic</strong>.<br><br></p><p>This Privacy Policy applies to our website, and its associated subdomains (collectively, our “Service”) alongside our application, <strong>AmedeeMusic</strong>. By accessing or using our Service, you signify that you have read, understood, and agree to our collection, storage, use, and disclosure of your personal information as described in this Privacy Policy and our Terms of Service.<br><br></p><h1><strong>Definitions and key terms</strong></h1><p>To help explain things as clearly as possible in this Privacy Policy, every time any of these terms are referenced, are strictly defined as:<br><br></p><ul><li>Cookie: small amount of data generated by a website and saved by your web browser. It is used to identify your browser, provide analytics, remember information about you such as your language preference or login information.</li><li>Company: when this policy mentions “Company,” “we,” “us,” or “our,” it refers to <strong>AmedeeMusic</strong>, (01700 Miribel - France) that is responsible for your information under this Privacy Policy.</li><li>Country: where <strong>AmedeeMusic </strong>or the owners/founders of <strong>AmedeeMusic </strong>are based, in this case is France</li><li>Customer: refers to the company, organization or person that signs up to use the <strong>AmedeeMusic </strong>Service to manage the relationships with your consumers or service users.</li><li>Device: any internet connected device such as a phone, tablet, computer or any other device that can be used to visit <strong>AmedeeMusic </strong>and use the services.</li><li>IP address: Every device connected to the Internet is assigned a number known as an Internet protocol (IP) address. These numbers are usually assigned in geographic blocks. An IP address can often be used to identify the location from which a device is connecting to the Internet.</li><li>Personnel: refers to those inpiduals who are employed by <strong>AmedeeMusic </strong>or are under contract to perform a service on behalf of one of the parties.</li><li>Personal Data: any information that directly, indirectly, or in connection with other information — including a personal identification number — allows for the identification or identifiability of a natural person.</li><li>Service: refers to the service provided by <strong>AmedeeMusic </strong>as described in the relative terms (if available) and on this platform.</li><li>Third-party service: refers to advertisers, contest sponsors, promotional and marketing partners, and others who provide our content or whose products or services we think may interest you.</li><li>Website: <strong>AmedeeMusic</strong>.\"’s\" site, which can be accessed via this URL: <a href=\"https://amedeemusic.com/\">amedeemusic.com</a></li><li>You: a person or entity that is registered with <strong>AmedeeMusic </strong>to use the Services.</li></ul><p><br></p><h1><strong>What Information Do We Collect?</strong></h1><p>We collect information from you when you visit our website, register on our site, place an order, subscribe to our newsletter, respond to a survey or fill out a form.<br><br></p><ul><li>Name / Username</li><li>Email Addresses</li></ul><p><br></p><h1><strong>How Do We Use The Information We Collect?</strong></h1><p>Any of the information we collect from you may be used in one of the following ways:<br><br></p><ul><li>To personalize your experience (your information helps us to better respond to your inpidual needs)</li><li>To improve our website (we continually strive to improve our website offerings based on the information and feedback we receive from you)</li><li>To improve customer service (your information helps us to more effectively respond to your customer service requests and support needs)</li><li>To process transactions</li><li>To administer a contest, promotion, survey or other site feature</li><li>To send periodic emails</li></ul><p><br></p><h1><strong>When does AmedeeMusic use end user information from third parties?</strong></h1><p><strong>AmedeeMusic </strong>will collect End User Data necessary to provide the <strong>AmedeeMusic </strong>services to our customers.<br><br></p><p>End users may voluntarily provide us with information they have made available on social media websites. If you provide us with any such information, we may collect publicly available information from the social media websites you have indicated. You can control how much of your information social media websites make public by visiting these websites and changing your privacy settings.<br><br></p><h1><strong>When does AmedeeMusic use customer information from third parties?</strong></h1><p>We receive some information from the third parties when you contact us. For example, when you submit your email address to us to show interest in becoming a <strong>AmedeeMusic </strong>customer, we receive information from a third party that provides automated fraud detection services to <strong>AmedeeMusic</strong>. We also occasionally collect information that is made publicly available on social media websites. You can control how much of your information social media websites make public by visiting these websites and changing your privacy settings.<br><br></p><h1><strong>Do we share the information we collect with third parties?</strong></h1><p>We may share the information that we collect, both personal and non-personal, with third parties such as advertisers, contest sponsors, promotional and marketing partners, and others who provide our content or whose products or services we think may interest you. We may also share it with our current and future affiliated companies and business partners, and if we are involved in a merger, asset sale or other business reorganization, we may also share or transfer your personal and non-personal information to our successors-in-interest.<br><br></p><p>We may engage trusted third party service providers to perform functions and provide services to us, such as hosting and maintaining our servers and the website, database storage and management, e-mail management, storage marketing, credit card processing, customer service and fulfilling orders for products and services you may purchase through the website. We will likely share your personal information, and possibly some non-personal information, with these third parties to enable them to perform these services for us and for you.<br><br></p><p>We may share portions of our log file data, including IP addresses, for analytics purposes with third parties such as web analytics partners, application developers, and ad networks. If your IP address is shared, it may be used to estimate general location and other technographics such as connection speed, whether you have visited the website in a shared location, and type of the device used to visit the website. They may aggregate information about our advertising and what you see on the website and then provide auditing, research and reporting for us and our advertisers.&nbsp;<br><br></p><p>We may also disclose personal and non-personal information about you to government or law enforcement officials or private parties as we, in our sole discretion, believe necessary or appropriate in order to respond to claims, legal process (including subpoenas), to protect our rights and interests or those of a third party, the safety of the public or any person, to prevent or stop any illegal, unethical, or legally actionable activity, or to otherwise comply with applicable court orders, laws, rules and regulations.&nbsp;<br><br></p><h1><strong>Where and when is information collected from customers and end users?</strong></h1><p><strong>AmedeeMusic </strong>will collect personal information that you submit to us. We may also receive personal information about you from third parties as described above.<br><br></p><h1><strong>How Do We Use Your Email Address?</strong></h1><p>By submitting your email address on this website, you agree to receive emails from us. You can cancel your participation in any of these email lists at any time by clicking on the opt-out link or other unsubscribe option that is included in the respective email. We only send emails to people who have authorized us to contact them, either directly, or through a third party. We do not send unsolicited commercial emails, because we hate spam as much as you do. By submitting your email address, you also agree to allow us to use your email address for customer audience targeting on sites like Facebook, where we display custom advertising to specific people who have opted-in to receive communications from us. Email addresses submitted only through the order processing page will be used for the sole purpose of sending you information and updates pertaining to your order. If, however, you have provided the same email to us through another method, we may use it for any of the purposes stated in this Policy. Note: If at any time you would like to unsubscribe from receiving future emails, we include detailed unsubscribe instructions at the bottom of each email.<br><br></p><h1><strong>How Long Do We Keep Your Information?</strong></h1><p>We keep your information only so long as we need it to provide <strong>AmedeeMusic </strong>to you and fulfill the purposes described in this policy. This is also the case for anyone that we share your information with and who carries out services on our behalf. When we no longer need to use your information and there is no need for us to keep it to comply with our legal or regulatory obligations, we’ll either remove it from our systems or depersonalize it so that we can\'t identify you.<br><br></p><h1><strong>How Do We Protect Your Information?</strong></h1><p>We implement a variety of security measures to maintain the safety of your personal information when you place an order or enter, submit, or access your personal information. We offer the use of a secure server. All supplied sensitive/credit information is transmitted via Secure Socket Layer (SSL) technology and then encrypted into our Payment gateway providers database only to be accessible by those authorized with special access rights to such systems, and are required to keep the information confidential. After a transaction, your private information (credit cards, social security numbers, financials, etc.) is never kept on file. We cannot, however, ensure or warrant the absolute security of any information you transmit to <strong>AmedeeMusic </strong>or guarantee that your information on the Service may not be accessed, disclosed, altered, or destroyed by a breach of any of our physical, technical, or managerial safeguards.<br><br></p><h1><strong>Could my information be transferred to other countries?</strong></h1><p><strong>AmedeeMusic </strong>is incorporated in France. Information collected via our website, through direct interactions with you, or from use of our help services may be transferred from time to time to our offices or personnel, or to third parties, located throughout the world, and may be viewed and hosted anywhere in the world, including countries that may not have laws of general applicability regulating the use and transfer of such data. To the fullest extent allowed by applicable law, by using any of the above, you voluntarily consent to the trans-border transfer and hosting of such information.<br><br></p><h1><strong>Is the information collected through the AmedeeMusic Service secure?</strong></h1><p>We take precautions to protect the security of your information. We have physical, electronic, and managerial procedures to help safeguard, prevent unauthorized access, maintain data security, and correctly use your information. However, neither people nor security systems are foolproof, including encryption systems. In addition, people can commit intentional crimes, make mistakes or fail to follow policies. Therefore, while we use reasonable efforts to protect your personal information, we cannot guarantee its absolute security. If applicable law imposes any non-disclaimable duty to protect your personal information, you agree that intentional misconduct will be the standards used to measure our compliance with that duty.<br><br></p><h1><strong>Can I update or correct my information?</strong></h1><p>The rights you have to request updates or corrections to the information <strong>AmedeeMusic </strong>collects depend on your relationship with <strong>AmedeeMusic</strong>. Personnel may update or correct their information as detailed in our internal company employment policies.<br><br></p><p>Customers have the right to request the restriction of certain uses and disclosures of personally identifiable information as follows. You can contact us in order to (1) update or correct your personally identifiable information, (2) change your preferences with respect to communications and other information you receive from us, or (3) delete the personally identifiable information maintained about you on our systems (subject to the following paragraph), by cancelling your account. Such updates, corrections, changes and deletions will have no effect on other information that we maintain, or information that we have provided to third parties in accordance with this Privacy Policy prior to such update, correction, change or deletion. To protect your privacy and security, we may take reasonable steps (such as requesting a unique password) to verify your identity before granting you profile access or making corrections. You are responsible for maintaining the secrecy of your unique password and account information at all times.<br><br></p><p>You should be aware that it is not technologically possible to remove each and every record of the information you have provided to us from our system. The need to back up our systems to protect information from inadvertent loss means that a copy of your information may exist in a non-erasable form that will be difficult or impossible for us to locate. Promptly after receiving your request, all personal information stored in databases we actively use, and other readily searchable media will be updated, corrected, changed or deleted, as appropriate, as soon as and to the extent reasonably and technically practicable.<br><br></p><p>If you are an end user and wish to update, delete, or receive any information we have about you, you may do so by contacting the organization of which you are a customer.<br><br></p><h1><strong>Personnel</strong></h1><p>If you are a <strong>AmedeeMusic </strong>worker or applicant, we collect information you voluntarily provide to us. We use the information collected for Human Resources purposes in order to administer benefits to workers and screen applicants.<br><br></p><p>You may contact us in order to (1) update or correct your information, (2) change your preferences with respect to communications and other information you receive from us, or (3) receive a record of the information we have relating to you. Such updates, corrections, changes and deletions will have no effect on other information that we maintain, or information that we have provided to third parties in accordance with this Privacy Policy prior to such update, correction, change or deletion.<br><br></p><h1><strong>Sale of Business</strong></h1><p>We reserve the right to transfer information to a third party in the event of a sale, merger or other transfer of all or substantially all of the assets of <strong>AmedeeMusic </strong>or any of its Corporate Affiliates (as defined herein), or that portion of <strong>AmedeeMusic </strong>or any of its Corporate Affiliates to which the Service relates, or in the event that we discontinue our business or file a petition or have filed against us a petition in bankruptcy, reorganization or similar proceeding, provided that the third party agrees to adhere to the terms of this Privacy Policy.<br><br></p><h1><strong>Affiliates</strong></h1><p>We may disclose information (including personal information) about you to our Corporate Affiliates. For purposes of this Privacy Policy, \"Corporate Affiliate\" means any person or entity which directly or indirectly controls, is controlled by or is under common control with <strong>AmedeeMusic</strong>, whether by ownership or otherwise. Any information relating to you that we provide to our Corporate Affiliates will be treated by those Corporate Affiliates in accordance with the terms of this Privacy Policy.<br><br></p><h1><strong>Governing Law</strong></h1><p>This Privacy Policy is governed by the laws of France without regard to its conflict of laws provision. You consent to the exclusive jurisdiction of the courts in connection with any action or dispute arising between the parties under or in connection with this Privacy Policy except for those inpiduals who may have rights to make claims under Privacy Shield, or the Swiss-US framework.<br><br></p><p>The laws of France, excluding its conflicts of law rules, shall govern this Agreement and your use of the website. Your use of the website may also be subject to other local, state, national, or international laws.<br><br></p><p>By using <strong>AmedeeMusic </strong>or contacting us directly, you signify your acceptance of this Privacy Policy. If you do not agree to this Privacy Policy, you should not engage with our website, or use our services. Continued use of the website, direct engagement with us, or following the posting of changes to this Privacy Policy that do not significantly affect the use or disclosure of your personal information will mean that you accept those changes.<br><br></p><h1><strong>Your Consent</strong></h1><p>We\'ve updated our Privacy Policy to provide you with complete transparency into what is being set when you visit our site and how it\'s being used. By using our website, registering an account, or making a purchase, you hereby consent to our Privacy Policy and agree to its terms.<br><br></p><h1><strong>Links to Other Websites</strong></h1><p>This Privacy Policy applies only to the Services. The Services may contain links to other websites not operated or controlled by <strong>AmedeeMusic</strong>. We are not responsible for the content, accuracy or opinions expressed in such websites, and such websites are not investigated, monitored or checked for accuracy or completeness by us. Please remember that when you use a link to go from the Services to another website, our Privacy Policy is no longer in effect. Your browsing and interaction on any other website, including those that have a link on our platform, is subject to that website’s own rules and policies. Such third parties may use their own cookies or other methods to collect information about you.<br><br></p><h1><strong>Cookies</strong></h1><p><strong>AmedeeMusic </strong>uses \"Cookies\" to identify the areas of our website that you have visited. A Cookie is a small piece of data stored on your computer or mobile device by your web browser. We use Cookies to enhance the performance and functionality of our website but are non-essential to their use. However, without these cookies, certain functionality like videos may become unavailable or you would be required to enter your login details every time you visit the website as we would not be able to remember that you had logged in previously. Most web browsers can be set to disable the use of Cookies. However, if you disable Cookies, you may not be able to access functionality on our website correctly or at all. We never place Personally Identifiable Information in Cookies.<br><br></p><h1><strong>Blocking and disabling cookies and similar technologies</strong></h1><p>Wherever you\'re located you may also set your browser to block cookies and similar technologies, but this action may block our essential cookies and prevent our website from functioning properly, and you may not be able to fully utilize all of its features and services. You should also be aware that you may also lose some saved information (e.g. saved login details, site preferences) if you block cookies on your browser. Different browsers make different controls available to you. Disabling a cookie or category of cookie does not delete the cookie from your browser, you will need to do this yourself from within your browser, you should visit your browser\'s help menu for more information.<br><br></p><h1><strong>Kids\' Privacy</strong></h1><p>We collect information from kids under the age of 13 just to better our services. If You are a parent or guardian and You are aware that Your child has provided Us with Personal Data without your permission, please contact Us. If We become aware that We have collected Personal Data from anyone under the age of 13 without verification of parental consent, We take steps to remove that information from Our servers.<br><br></p><h1><strong>Changes To Our Privacy Policy</strong></h1><p>We may change our Service and policies, and we may need to make changes to this Privacy Policy so that they accurately reflect our Service and policies. Unless otherwise required by law, we will notify you (for example, through our Service) before we make changes to this Privacy Policy and give you an opportunity to review them before they go into effect. Then, if you continue to use the Service, you will be bound by the updated Privacy Policy. If you do not want to agree to this or any updated Privacy Policy, you can delete your account.<br><br></p><h1><strong>Third-Party Services</strong></h1><p>We may display, include or make available third-party content (including data, information, applications and other products services) or provide links to third-party websites or services (\"Third- Party Services\"). You acknowledge and agree that <strong>AmedeeMusic </strong>shall not be responsible for any Third-Party Services, including their accuracy, completeness, timeliness, validity, copyright compliance, legality, decency, quality or any other aspect thereof. <strong>AmedeeMusic </strong>does not assume and shall not have any liability or responsibility to you or any other person or entity for any Third-Party Services. Third-Party Services and links thereto are provided solely as a convenience to you and you access and use them entirely at your own risk and subject to such third parties\' terms and conditions.<br><br></p><h1><strong>Tracking Technologies</strong></h1><ul><li>Cookies<br>We use Cookies to enhance the performance and functionality of our website but are non-essential to their use. However, without these cookies, certain functionality like videos may become unavailable or you would be required to enter your login details every time you visit the website as we would not be able to remember that you had logged in previously.</li><li>Local Storage<br>Local Storage sometimes known as DOM storage, provides web apps with methods and protocols for storing client-side data. Web storage supports persistent data storage, similar to cookies but with a greatly enhanced capacity and no information stored in the HTTP request header.<br><br></li></ul><h1><strong>Information about General Data Protection Regulation (GDPR)</strong></h1><p>We may be collecting and using information from you if you are from the European Economic Area (EEA), and in this section of our Privacy Policy we are going to explain exactly how and why is this data collected, and how we maintain this data under protection from being replicated or used in the wrong way.<br><br></p><h1><strong>What is GDPR?</strong></h1><p>GDPR is an EU-wide privacy and data protection law that regulates how EU residents\' data is protected by companies and enhances the control the EU residents have, over their personal data.<br><br></p><p>The GDPR is relevant to any globally operating company and not just the EU-based businesses and EU residents. Our customers’ data is important irrespective of where they are located, which is why we have implemented GDPR controls as our baseline standard for all our operations worldwide.<br><br></p><h1><strong>What is personal data?</strong></h1><p>Any data that relates to an identifiable or identified inpidual. GDPR covers a broad spectrum of information that could be used on its own, or in combination with other pieces of information, to identify a person. Personal data extends beyond a person’s name or email address. Some examples include financial information, political opinions, genetic data, biometric data, IP addresses, physical address, sexual orientation, and ethnicity.<br><br></p><p>The Data Protection Principles include requirements such as:<br><br></p><ul><li>Personal data collected must be processed in a fair, legal, and transparent way and should only be used in a way that a person would reasonably expect.</li><li>Personal data should only be collected to fulfil a specific purpose and it should only be used for that purpose. Organizations must specify why they need the personal data when they collect it.</li><li>Personal data should be held no longer than necessary to fulfil its purpose.</li><li>People covered by the GDPR have the right to access their own personal data. They can also request a copy of their data, and that their data be updated, deleted, restricted, or moved to another organization.</li></ul><p><br></p><h1><strong>Why is GDPR important?</strong></h1><p>GDPR adds some new requirements regarding how companies should protect inpiduals\' personal data that they collect and process. It also raises the stakes for compliance by increasing enforcement and imposing greater fines for breach. Beyond these facts it\'s simply the right thing to do. At Help Scout we strongly believe that your data privacy is very important and we already have solid security and privacy practices in place that go beyond the requirements of this new regulation.<br><br></p><h1><strong>Inpidual Data Subject\'s Rights - Data Access, Portability and Deletion</strong></h1><p>We are committed to helping our customers meet the data subject rights requirements of GDPR. <strong>AmedeeMusic </strong>processes or stores all personal data in fully vetted, DPA compliant vendors. We do store all conversation and personal data for up to 6 years unless your account is deleted. In which case, we dispose of all data in accordance with our Terms of Service and Privacy Policy, but we will not hold it longer than 60 days.<br><br></p><p>We are aware that if you are working with EU customers, you need to be able to provide them with the ability to access, update, retrieve and remove personal data. We got you! We\'ve been set up as self service from the start and have always given you access to your data and your customers data. Our customer support team is here for you to answer any questions you might have about working with the API.<br><br></p><h1><strong>California Residents</strong></h1><p>The California Consumer Privacy Act (CCPA) requires us to disclose categories of Personal Information we collect and how we use it, the categories of sources from whom we collect Personal Information, and the third parties with whom we share it, which we have explained above.<br><br></p><p>We are also required to communicate information about rights California residents have under California law. You may exercise the following rights:<br><br></p><ul><li>Right to Know and Access. You may submit a verifiable request for information regarding the: (1) categories of Personal Information we collect, use, or share; (2) purposes for which categories of Personal Information are collected or used by us; (3) categories of sources from which we collect Personal Information; and (4) specific pieces of Personal Information we have collected about you.</li><li>Right to Equal Service. We will not discriminate against you if you exercise your privacy rights.</li><li>Right to Delete. You may submit a verifiable request to close your account and we will delete Personal Information about you that we have collected.</li><li>Request that a business that sells a consumer\'s personal data, not sell the consumer\'s personal data.</li></ul><p>If you make a request, we have one month to respond to you. If you would like to exercise any of these rights, please contact us. We do not sell the Personal Information of our users. For more information about these rights, please contact us.<br><br></p><p>California Online Privacy Protection Act (CalOPPA)<br><br></p><p>CalOPPA requires us to disclose categories of Personal Information we collect and how we use it, the categories of sources from whom we collect Personal Information, and the third parties with whom we share it, which we have explained above.<br><br></p><p>CalOPPA users have the following rights:<br><br></p><ul><li>Right to Know and Access. You may submit a verifiable request for information regarding the: (1) categories of Personal Information we collect, use, or share; (2) purposes for which categories of Personal Information are collected or used by us; (3) categories of sources from which we collect Personal Information; and (4) specific pieces of Personal Information we have collected about you.</li><li>Right to Equal Service. We will not discriminate against you if you exercise your privacy rights.</li><li>Right to Delete. You may submit a verifiable request to close your account and we will delete Personal Information about you that we have collected.</li><li>Right to request that a business that sells a consumer\'s personal data, not sell the consumer\'s personal data.</li></ul><p><br></p><p>If you make a request, we have one month to respond to you. If you would like to exercise any of these rights, please contact us.<br><br></p><p>We do not sell the Personal Information of our users.<br><br></p><p>For more information about these rights, please contact us.<br><br></p><h1><strong>Contact Us</strong></h1><p>Don\'t hesitate to contact us if you have any questions.<br><br></p><ul><li>Via Email: amedee.management@gmail.com</li></ul>')");
    }

